import React from 'react';
import './Country.css';


export function Country () {
    let flag = "https://restcountries.eu/data/col.svg";
    let name = 'Colombia';
    let capital='Bogota'

    return (
        <div className='countryCard'>
            <div className="countryBody">
              <img src= {flag} />
              <div >
              <p>Nombre :</p>
              <p>{name}</p>
              </div>
              <div >
              <p>Capital :</p>
              <p>{capital}</p>
              </div>
            </div>
        </div>
    )
};

export default Country;
